import React from 'react';
import { useQuery } from '@apollo/react-hooks';
import gql from 'graphql-tag';

function Itineraries() {
    return (
        <div>
            <h1>Itineraries</h1>
        </div>
    );
}

const GET_USER_ITINERARIES = gql`
    query{
        getUserItineraries{
            id
            dayPlans{
                placeIds
            }
            createdAt
            user
            username
        }
    }
`

export default Itineraries;
